import { GET_DRIVEWAYS_FROM_DB, SET_FEATURES } from "../action-types/db-driveways-action-types";

export const dbDriveways = (dispatch, data) => {
  return dispatch({ type: GET_DRIVEWAYS_FROM_DB, payload: data });
};

export const formatFeatures = (dispatch, data) => {
  return dispatch({type: SET_FEATURES, payload: data})
}
